var maxRotateFunction = function (nums = []) {
    let total = Number.MIN_SAFE_INTEGER;

    let i = 0;
    const rotate = () => {
        let last = nums.pop()
        nums.unshift(last)
    };
    while (i < nums.length) {
        let sum = 0;

        for (let j = 0; j < nums.length; j++) {
            const element = nums[j];
            sum += element * j
        }

        total = Math.max(total, sum);
        rotate()
        i++
    }


    return total
};

